import React from 'react';
import { GoogleLogin } from '@react-oauth/google';
import './App.css';
import logo from './logo.svg';

function App() {
  // Функция, которая будет вызываться при успешном входе
  const handleLoginSuccess = (response) => {
    console.log('Login Success:', response);
    // Здесь можно обработать полученный токен, отправить его на сервер или сохранить в localStorage
  };

  // Функция, которая будет вызываться при ошибке входа
  const handleLoginFailure = (error) => {
    console.log('Login Failed:', error);
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>

        {/* Кнопка Google Login */}
        <GoogleLogin
          onSuccess={handleLoginSuccess}   // Успешный вход
          onError={handleLoginFailure}     // Ошибка при входе
        />

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
